void Config_pantalla(){
  display.begin(SSD1306_SWITCHCAPVCC, 0x3C);
  display.invertDisplay(false);
  display.setTextColor(WHITE); // Draw white text
  display.clearDisplay();
  display.display();
  delay(200);
}

void pantalla_inicio(){
  display.clearDisplay();       // Clear display buffer

  display.setTextSize(1);       // Normal 1:1 pixel scale
  display.setCursor(0, 10);     // Start at top-left corner
  display.print("Estado del sistema");

  display.display(); // Update screen with each newly-drawn line

  display.setTextSize(2);       // Normal 2:1 pixel scale
  display.setCursor(0, 30);     // Start at top-left corner
  display.print("Esperando");

  display.display(); // Update screen with each newly-drawn line

  display.startscrollright(0x00, 0xFF);
  delay(1000);
  display.stopscroll();
  display.startscrollleft(0x00, 0xFF);
  delay(1000);
  display.stopscroll();
}

void pantalla_pin_error(){
  display.clearDisplay();       // Clear display buffer

  display.setTextSize(3);       // Normal 1:1 pixel scale
  display.setCursor(20, 5);     // Start at top-left corner
  display.print("ERROR");

  display.setTextSize(2);       // Normal 2:1 pixel scale
  display.setCursor(22, 35);     // Start at top-left corner
  display.print("Pin mal");

  display.display(); // Update screen with each newly-drawn line
}

