  display.drawLine(0, 49, 128, 49, WHITE);
  display.drawLine(64, 49, 64, 64, WHITE);

  display.setCursor(10, 54);     // Start at top-left corner
  display.print("* Clear");
  display.setCursor(79, 54);     // Start at top-left corner
